Up for auction is a NIB Sig Sauer model 551 A1, rifle will come as pictured, includes 3 magazines, 2-30s and one 20 rd. mag. From Sigs website; 

TACTICAL PRECISION, For 2011, SIG SAUER® is offering several variants to its tactical platforms. NEW to this lineup is our new SIG551-A1, chambered for the widely used 5.56 x 45mm NATO caliber using Swiss Polymer magazines. The SIG551-A1 features a distinctive swiss folding stock, and an M1913 rail for accessory attachment. The 16” barrel features six-groove rifling and a twist rate of 1:7”. The SIG551-A1 measures 36.1” but can fold to 26”, making it ideal for situations where maximum maneuverability is required. For Special Forces requiring an accurate, more potent rifle, chambered in 5.56 x 45mm NATO, the SIG551-A1 sets a new standard for dependable operation and function. 

Specs include; 1:7" twist 16" barrel, 36.1" overall length, 26.0" length folded, 7.0 lbs. unloaded, gas piston, rotary diopter adjustable sights. Comes with two Sig 30 rd. magazines, manual, lock, Sig case and oil bottle. Now includes an extra 20 rd. Sig magazine

I'd like to trade my NAA Mini .22WMR magnum revolver package.  It's nice and clean but just doesn't fit my needs.  It comes with the flip out belt clip grips (installed), original wood grips, paperwork, case, holster, and three 50 round boxes of Hornady Critical Defense.

There are several things I'm interested in:

Quality .380 (such as a Bersa Thunder CC) and ammo;
Two quality Mosin Nagants or
One quality Mosin Nagant and an ammo can of 7.62x54;
Quality .50 cal Muzzleloader;
Ruger LCP and ammo/holster;
or a Remington Nylon 66 and ammo.

I'd also be interested in trading this and boot for any of the following:

S&W 686-4 Plus;
S&W 66-1 with a 3" or 4" barrel;
S&W 6906;
Ruger GP100 with a 3" or 4" barrel;
Ruger Mark III Hunter;
VEPR 7.62x54;
or Remington Nylon 66 Apache Black.

I'd entertain offers for ammo as well.  Please understand, though, that I will not entertain inflated ammo prices.  I am keeping the value of my gun fair and will not pay $1 for 7.62 NATO, 50 cents for .223, more than .40 cents for 40S&W, etc.  You get the idea.  I can use any of the following calibers:

.22lr, 40S&W, .38 Special, .357 Magnum, .44 Magnum, .308, 7.62 NATO, .223, and 7x57 Mauser.

The Mini Mag is a cool gun that needs to go to a home that will use it more than I will or to a collector.  I'm a shooter more than a collector so hit me up with a quality firearm like any of those above and hopefully we can work something out.

Thanks for your time!
J
